import datetime
import logging

# Configure logging
logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(levelname)s - %(message)s')

class DataManager:
    def __init__(self):
        self.data_store = {}

    def delete_outdated_data(self, date):
        logging.info(f"Processing deletions for date: {date}")
        to_delete = [k for k, v in self.data_store.items() if v['date'] < date]
        for key in to_delete:
            del self.data_store[key]
            logging.info(f"Deleted data entry with key: {key}")

